import ReactDOM from "react-dom/client";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import Header from "./header.js";
import "./index.css";

// ROUTES
import Home from "./home.js";
import About from "./about.js";

import Inventory from "./inventory.js";
import Financing from "./financing.js";
import TradeIn from "./trade-in.js";
import PayOnline from "./pay-online.js";
import ContactUs from "./contact-us.js";

function App() {
  return (
    <BrowserRouter>
      <Header />
      <main>
        <Routes className="routes-container">
          <Route path="/home" element={<Home />}></Route>
          <Route path="/aboutus" element={<About />}></Route>
          <Route path="/inventory" element={<Inventory />}></Route>
          <Route path="/financing" element={<Financing />}></Route>
          <Route path="/tradein" element={<TradeIn />}></Route>
          <Route path="/payonline" element={<PayOnline />}></Route>
          <Route path="/contact" element={<ContactUs />}></Route>
        </Routes>
      </main>
    </BrowserRouter>

    // <BrowserRouter
  );
}

export default App;
